  background-color: #282c34;
  padding: 20px;
  color: white;
  text-align: center;
`;

function Header() {
  return (
    <HeaderWrapper>
      <h1>e-Books</h1>
      {/* Add navigation links or other elements here */}
    </HeaderWrapper>
  );
}

export default Header;
